import React from 'react';
import './InputBox.css';

const InputBox = (props) => {
  const {name, text, type, value } = props;
  console.log(props);
  return(
    <div className='input-box'>
      <label htmlFor={name}>{text}</label>
      <input type={type} name={name} id={name} required={true} value={value} onChange={() => props.handleChange('name')} ></input>
    </div>
  )
}

export default InputBox;
